import './Missions.css'

function Missions() {
	return (
		<div className='Missions'>
			<div className='missionsCards'>
				<div className='card'>
					<img src='MissionsBorder' alt='MissionsImg'></img>
				</div>
			</div>
		</div>
	)
}

export default Missions
